import { AppContext } from "../context/AppContext";

const Currency = () => {
    // const { currency } = useContext(AppContext);
    const [newCurrency, setCurrency] = useState('£ Pound')

    return (
        <div className="alert alert-primary" class="custom-select" style="width:200px;">
            <span>Currency</span>
            <select className="custome-select" id="inputGroupSelect01" onChange={(event) => setCurrency(event.target.value)}>
                <option defaultValue value='£ Pound' name='Pound'>£ Pound</option>
